import MultiPlayer from './MultiPlayer.js'
import './Todos.jsx';


function App() {
  return (
    <div className="App">
      <header className="App-header">

        <form >
          <label>
            Name:
            <input type="text" name="name">
            </input>
          </label>
          <input type="submit">
          </input>
        </form>
        <div className="App">
          <MultiPlayer
            urls={[
              'https://dictionary.cambridge.org/media/english/us_pron/g/goo/good_/good.mp3'
            ]}
          />
        </div>
      </header>
    </div>
  );
}

export default App;
